column11:
Vybudovat skvělou právní podporu pro rozvoj banky a její obchodní aktivity a potřeby; Provádět právně konkrétní "akce" v bance - např. konání valných hromad; 
Nastavit efektivní využívání právních služeb; Pracovat jen s nejlepšími. 
Podporovat IT tým a být respektovaným členem BoD v této oblasti i před IT odborníky funkčně pode mnou.
